  },
  computed: {
    ...mapGetters([
      'user'
    ]),
  },
  methods: {
    ...mapActions(['Logout']),
    logout() {
      this.$confirm('确认退出吗?', '提示', {
        type: 'warning'
      }).then(() => {
        this.$post('/api/v2/logout').then(res => {
          this.$message.success(res.message)
          this.Logout()
          this.$router.push('/login')
        }).cathc(err => {})
      }).catch(() => {
      })
    },
    goindex() {
      let routeData = this.$router.resolve({ path: '/'});
      window.open(routeData.href, '_blank');
    }
  }

}
